import React from "react";

const heading = [
  {
    entryHeading: "Cycle 2",
  },
  {
    dateRange: "16 Sep - 30 Sep",
  },
];

const entries = [
  {
    userName: "Abhijeet Acharya",
  },
  {
    price: "1200",
  },
  {
    additionalInfo: "MH/2222483703",
  },
  {
    dateIssue: "Issued on 12 Dec - 2020",
  },
];

const Entryheading = ({ heading }) => {
  return (
    <ul className="entry-heading">
      const renderList = heading.map(items =>
      {
        <li>
          {items.entryHeading}
          {items.dateRange}
        </li>
      }
      )
    </ul>
  );
};

const Userentries = () => {
  return (
    <section className="wrap-entries">
      <Entryheading renderList={heading} />
      <ul className="user-entries">
        <li>
          <p>
            {entries[0].userName}
            <span>{entries[1].price}</span>
          </p>
          <p>{entries[2].additionalInfo}</p>
          <p>{entries[3].dateIssue}</p>
        </li>
      </ul>
    </section>
  );
};

export default Userentries;
